    [],nt"num_tags": 7,nt"name": "northwest-montana-wetland-management-district-annual-narrative-calendar-year-1992",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Northwest
    Montana WMD outlines Refuge accomplishments during the 1992 calendar year. The report
    begins with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses management planning,
    compliance with environmental and cultural resource mandates, and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    volunteer programs, funding, safety, and technical assistance is given. Habitat
    management is also covered; subjects include wetlands, croplands, grasslands, grazing,
    haying, fire management, pest control, and water rights. The wildlife section of
    the report discusses endangered and threatened species, waterfowl, marsh birds and
    waterbirds, shorebirds, raptors, game mammals, fisheries resources, animal control,
    and marking and bird banding. The public uses of the Refuge described in this report
    include outdoor classrooms, hunting, fishing, trapping, and law enforcement. The
    equipment and facilities section of the report provides information about new construction,
    rehabilitation, and equipment replacement.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
